import React from 'react';
import { ResponsiveLine } from '@nivo/line';
import data from './Data.json'
import Moment from 'moment';

const chartdata = data.data

const UnitDemand = () => {

    return (
        <div style={{ height: '500px', width: '800px' }}>
            <ResponsiveLine


                markers={[
                   /*  {
                        axis: 'y',
                        value: 10,
                        lineStyle: { stroke: '#b0413e', strokeWidth: 2 },
                        legend: 'y marker',
                        legendOrientation: 'vertical',
                    }, */
                    {
                        axis: 'x',
                        value: chartdata[0].data[5].x,
                        lineStyle: { stroke: '#b0413e', strokeWidth: 2 },
                        legend: 'Present Date',
                    },
                ]}
                data={chartdata}
                margin={{ top: 50, right: 110, bottom: 50, left: 60 }}
                xScale={{ type: 'point', min: 'auto', max: 'auto', stacked: true, reverse: false  }}
                yScale={{ type: 'linear', min: 'auto', max: 'auto', stacked: true, reverse: false }}
                curve="monotoneX"
                axisTop={null}
                axisRight={null}
                axisBottom={{
                    orient: 'bottom',
                    tickSize: 5,
                    tickPadding: 5,
                    tickRotation: 0,
                    legend: 'transportation',
                    legendOffset: 36,
                    legendPosition: 'middle',
                    tickRotation: 90
                }}
                axisLeft={{
                    orient: 'left',
                    tickSize: 5,
                    tickPadding: 5,
                    tickRotation: 0,
                    legend: 'count',
                    legendOffset: -40,
                    legendPosition: 'middle'
                }}
                colors={{ scheme: 'nivo' }}
                pointSize={7}
                pointColor={{ theme: 'background' }}
                pointBorderWidth={2}
                pointBorderColor={{ from: 'serieColor' }}
                pointLabel="y"
                pointLabelYOffset={-12}
                useMesh={true}
                legends={[
                    {
                        anchor: 'bottom-right',
                        direction: 'column',
                        justify: false,
                        translateX: 100,
                        translateY: 0,
                        itemsSpacing: 0,
                        itemDirection: 'left-to-right',
                        itemWidth: 80,
                        itemHeight: 20,
                        itemOpacity: 0.75,
                        symbolSize: 12,
                        symbolShape: 'circle',
                        symbolBorderColor: 'rgba(0, 0, 0, .5)',
                        effects: [
                            {
                                on: 'hover',
                                style: {
                                    itemBackground: 'rgba(0, 0, 0, .03)',
                                    itemOpacity: 1
                                }
                            }
                        ]
                    }
                ]}
            />
        </div>
    )
}

export default UnitDemand;
